/*Table structure for table `t_preschedule` */

DROP TABLE IF EXISTS `t_preschedule`;

CREATE TABLE `t_preschedule` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `schedule_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '主键自增',
  `class_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '班级',
  `classroom_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '课室',
  `course_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '课程',
  `teacher_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '教师号',
  `time_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '上课时间',
  `remark` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注',
  `class_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '班级名称',
  `place` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '教学地点',
  `course_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '课程名称',
  `teacher_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '教师名字',
  `day` varchar(50) DEFAULT NULL COMMENT '星期几',
  `hour` varchar(50) DEFAULT NULL COMMENT '第几节',
  PRIMARY KEY (`id`),
  KEY `fk_classId` (`class_id`),
  KEY `fk_classroomId` (`classroom_id`),
  KEY `fk_courseId` (`course_id`),
  KEY `fk_teacherId` (`teacher_id`),
  CONSTRAINT `fk_classId` FOREIGN KEY (`class_id`) REFERENCES `t_class` (`class_id`),
  CONSTRAINT `fk_classroomId` FOREIGN KEY (`classroom_id`) REFERENCES `t_classroom` (`classroom_id`),
  CONSTRAINT `fk_courseId` FOREIGN KEY (`course_id`) REFERENCES `t_course` (`course_id`),
  CONSTRAINT `fk_teacherId` FOREIGN KEY (`teacher_id`) REFERENCES `t_teacher` (`teacher_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

