/*Table structure for table `t_time` */

DROP TABLE IF EXISTS `t_time`;

CREATE TABLE `t_time` (
  `time_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '上课时间代码',
  `week` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '第几周  序号 1到20',
  `day` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '一周中的第几天  序号1到7',
  `hour` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '时间段 一天7个时间段 序号1到7',
  `remark` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`time_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='时间段表';

